import React, { useState, useEffect } from 'react'

const Test = () => {

    const [user, setUser] = useState(null)
    const [searchQuery, setSearchQuery] = useState('Emad')


    return (
        <div>
            <input
                type='search'
                value={searchQuery}
                onChange={event => setSearchQuery()}

            />


            {
                user ? (
                    <div>

                        <h2>{user.name}</h2>
                        <h2>{user.username}</h2>
                        <h2>{user.email}</h2>
                    </div>


                ) : <span>user can not find</span>


            }


        </div>
    )
}

export default Test
